import React, { Component } from 'react';
import logo from '../img/logo_42.jpeg';

class Header extends Component {
    // state = {  }
    render() { 
        return <div className="header">
            <img src={logo} alt="42 logo" className="header--logo"></img>         
            <div className="header__nav">
                <div className="header__nav--home"></div>
                <div className="header__nav--studies"></div>
                <div className="header__nav--projects"></div>
            </div>
        </div>
    }
}

export default Header;
